/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div class="ui5-popover-root" role="dialog" aria-modal="true" aria-labelledby="ui5-popover-header" style=${styleMap(context.styles.root)}><span class="first-fe" tabindex="0" @focusin=${context.forwardToLast}></span><span class="ui5-popover-arr" style="${styleMap(context.styles.arrow)}"></span>	${ context._displayHeader ? block1(context) : undefined }<div class="ui5-popover-content" style=${styleMap(context.styles.content)}><slot></slot></div>	${ context._displayFooter ? block4(context) : undefined }<span class="last-fe" tabindex="0" @focusin=${context.forwardToFirst}></span></div>`; };
const block1 = (context) => { return html`${ context.header.length ? block2(context) : block3(context) }`; };
const block2 = (context) => { return html`<div class="ui5-popover-header-root" id="ui5-popover-header" role="toolbar"><slot name="header"></slot></div>		`; };
const block3 = (context) => { return html`<h2 class="ui5-popup-header-text" id="ui5-popover-header">${ifDefined(context.headerText)}</h2>		`; };
const block4 = (context) => { return html`${ context.footer.length ? block5(context) : undefined }`; };
const block5 = (context) => { return html`<div class="ui5-popover-footer-root" role="toolbar"><slot name="footer"></slot></div>		`; };

export default block0;
